5,940sqm High bay warehouse; 
1,258sqm Corporate grade office accommodation; 
13,500sqm General Industry (B) land holding; 
ESFR Sprinkler system; 
Two-street drive through access; 
Large 3 phase power supply (transformer onsite); 
Ability to split the building into two tenancies;
Excellent truck access, external storage and manoeuvring area 

